@mulatxinha_goxtozah: Hi there, i was in the same boat as you, asmariamoon kindly gave me the answer i was looking for so im probiding it for you:

"asmariamoon at 2011-07-15 22:25 CET:
@hails592 Episodes 23 and 24 have yet to be aired. They're called Team Rocket VS. Team Plasma Parts 1 and 2, but due to the earthquake and tsunami that hit Japan back in March, they haven't even been aired in Japan yet, which means we'll have to wait for them to be aired there before we get the dubs. Sadly, according to Wikipedia and Bulbapedia, they've been postponed indefinitely, so we may never get them."
